Conquering my cheesecake fears with Mini Black Forest Cheesecake
.
.
.
Cheesecake is one of my all time favourite desserts and yet I'd always been too scared to make it. Cream cheese is not the cheapest ingredient back home so I was excited to experiment with some trial and effor after I moved. Took me nearly a year! 😅
.
I have had a block of cream cheese sitting in my fridge for a couple of months and I finally decided to give it a go for "Variants of Cheesecake".
.
I did some research and came across this idea for a black forest cheesecake and saw @thebrowneyedbaker 's recipe. I had seen this years ago when she first posted in her blog and it was love at first sight. So I knew that's what I had to make. 
.
The verdict,  I loved it. I went with mini cheesecakes instead of a full blown one. It had some spectacular mini cracks when I took it out of the oven (I might have overbaked a tad) but it was hidden by the sweet cherry topping and the whipped cream.
.
The cherry topping coupled with the chocolate cheesecake tasted absolutely delicious. Try this guys, you won't regret it!
.
.
This week’s theme is Variants of Cheesecake chosen by @mils_kitchen_ .

